import React from "react";
import styled from 'styled-components';

const Wrapper = styled.div`
  margin: 50px 125.5px 0 125.5px;
`

export const About = () => {
    return <Wrapper>
        <h1>
            Мобильный <span>ID</span>
        </h1>
    </Wrapper>
}
